import React from 'react';
import { Question, AnswerCircle } from '../../assets/svg';
import styles from './game.module.css';

const Game = () => {
  return (
    <div className={styles.game}>
        <Question/>
        <AnswerCircle/>
    </div>
  )
}

export default Game;
